import React from 'react';
import './Login.css'


function Login() {
  return (
   <>
   <div className='container'>
   <div className='card'>
   <form>
    <div className='form-group'>
    <label for="exampleInputEmail1">Please Enter the code</label>
    <input type="email" class="form-control" id="exampleInputEmail1"  placeholder="Enter the code"/>
 <button type="button" className="btn btn-secondary btn-block">LOGIN</button>
    </div>
   </form>
   </div>
   </div>
   </>
  )
}

export default Login;
